import React from 'react';

import './radarscreen.styles.css';

const arr = [[1, 2, 3, 4],[3, 6, 8, 0],['A', 'B', 'C', 'D']]

const RadarScreen = () => {
	let i=0;

	return(
		<div className="radarscreen">
			<div className='space'>
			</div>

			{/* <div id="resizable">
			</div> */}
			<div id="grid-container">
				<div className="" style={{backgroundColor: 'black'}}>Test</div>
				{arr.map((value, col) => value.map((rowVal,row) => {return (
					<div key={col+'col'+row+'row'} id={col} >
						{rowVal}
					</div>
				)}))}
			</div>
	</div>
	)
}

export default RadarScreen;
